-- Table structure for users__for_activity
-- ----------------------------
DROP TABLE IF EXISTS `users__for_activity`;
CREATE TABLE `users__for_activity`  (
  `id` bigint UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint UNSIGNED NOT NULL COMMENT '外键 用户id',
  `activity_id` bigint NOT NULL COMMENT '外键 活动id',
  `date` date NOT NULL COMMENT '日期',
  `qrcode` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL COMMENT '活动qrcode',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `ix_user_activity`(`user_id` ASC, `activity_id` ASC, `date` ASC) USING BTREE,
  INDEX `fk_activityid_i`(`activity_id` ASC) USING BTREE,
  CONSTRAINT `fk_activityid_i` FOREIGN KEY (`activity_id`) REFERENCES `activity` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `fk_usersid_for_activity` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 1005 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

