-- ----------------------------
-- View structure for order_details_view
-- ----------------------------
DROP VIEW IF EXISTS `order_details_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `order_details_view` AS select `booking`.`id` AS `id`,`booking`.`timeSlot` AS `timeSlot`,`booking`.`date` AS `date`,`booking`.`qr_code` AS `qrcode`,`users`.`phone` AS `phone`,`users`.`username` AS `username`,json_object('id',`users`.`id`,'username',`users`.`username`,'phone',`users`.`phone`,'organization',`users`.`organization`) AS `avatar`,json_arrayagg(json_object('id',`activity`.`id`,'title',`activity`.`title`,'desc',`activity`.`desc_`,'price',`activity`.`price`,'qrcode',`users__for_activity`.`qrcode`,'image',`activity_images_json`.`image_urls`)) AS `activity` from ((((`booking` join `users` on((`booking`.`user_id` = `users`.`id`))) join `users__for_activity` on((`booking`.`user_id` = `users__for_activity`.`user_id`))) join `activity` on((`users__for_activity`.`activity_id` = `activity`.`id`))) join (select `activity`.`id` AS `activity_id`,json_arrayagg(`activity_images`.`image_url`) AS `image_urls` from (`activity` join `activity_images` on((`activity`.`id` = `activity_images`.`activity_id`))) group by `activity`.`id`) `activity_images_json` on((`activity`.`id` = `activity_images_json`.`activity_id`))) group by `booking`.`id`;

-- ----------------------------
-- Triggers structure for table users__for_activity
-- ----------------------------
DROP TRIGGER IF EXISTS `check_booking_exists`;
delimiter ;;
CREATE TRIGGER `check_booking_exists` BEFORE INSERT ON `users__for_activity` FOR EACH ROW BEGIN
    DECLARE booking_count INT;

    -- 检查在 booking 表中是否存在符合条件的记录
    -- 先入校预约 再 活动预约
    SELECT COUNT(*)
    INTO booking_count
    FROM booking
    WHERE user_id = NEW.user_id
      AND date = NEW.date;


    -- 如果 booking 记录不存在，抛出错误
    IF booking_count = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = '用户在该日期没有预订记录';
    END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
