INSERT INTO `activity` VALUES (1, '澳门科技大学将于开放日当天举行「杰出经济学人讲座系列讲座」。本校特别邀请到国际知名经济学家、原世界银行资深副总裁、中国经济权威、澳科大2016年荣誉工商管理博士林毅夫教授进行主题演讲，届时将邀请本澳经济及政策研究等方面的专家学者出席活动及进行圆桌讨论，祈望通过是次高水平的学术讲座及交流讨论，提升各界对中国和国际经济的认识和理解。 本次活动由澳科大商学院和发展经济学研究所共同主办。\n讲座结束后还将有澳科大的老师和同学与开放日的参与者们分享澳科大的校园生活。\n正式讲座将于14:00-15:30举行。\n', 0, '讲座 D座礼堂');
INSERT INTO `activity` VALUES (2, '本次展览精选64幅历史上最重要或最具代表性的澳门城图，其中不乏首次披露。 例如，本馆从新加坡国立大学博物馆高精度复制的十八世纪下半叶《澳门至香山城山水长卷》，老楞佐图书馆藏芬彭士绘《澳门城图》稀见写本、英国皇家地图学会藏《澳门 入广水道形势图》等。 展览分为六个部分，包括（一）中文澳门城图、（二）早期葡国绘澳门城图、（三）17世纪荷兰绘澳门城图、（四）18世纪西洋各国绘澳门城图、 （五）鸦片战争前后实测澳门城图、（六）近现代澳门城图。 澳门城因港而生，因港而兴。 从这些展品中我们可以窥见近五个世纪澳门港城的繁华鼎盛，也可以看到澳门发展生长的城市肌理，感悟澳门的前世今生与沧桑巨变。 这些古地图不仅是研究澳门历史的珍贵图像史料，为相关研究提出许多新证据和线索、填补历史的空白；同时也揭示了澳门港城与祖国内地城市之间的密切互动和联系。 通过这些古地图来回顾澳门历史，相信将会启发观众思考，如何在「一国两制」的基本架构下结合国家对澳门「一中心、一平台、一基地」的发展定位，凝聚澳门情怀，传承中华文化 和拥抱大湾区建设，在新时期继续发挥澳门的重要作用。', 10, '古地图展览 N座图书馆');
INSERT INTO `activity` VALUES (3, '本次展览主要包括人文艺术学院的艺术学-艺术设计学士学位课程，设计学硕士学位课程，设计学博士生学位课程，美术学硕士学位课程，美术学博士学位课程，建筑学硕士学位课程及建筑学博士学位课程的作品。其专业范畴分别是：艺术设计学士学位课程的产品设计、景观设计、室内设计及视觉传达设计专业；设计学硕士学位课程的传播设计、产品设计、室内设计、服装与纺织品设计、设计管理及文化遗产保护专业；以及设计学博士学位课程的艺术设计理论与实践、设计管理及文化遗产保护专业；美术学硕士及博士学位课程的绘画创作实践与理论专业；以及建筑学硕士学位课程的建筑遗产保护、滨水都市建筑与设计专业；建筑学博士学位课程。本次展览充分展现了人文艺术学院同学们的探索和创新精神，即使这种氛围没有实体也无法衡量，但它是真实存在且观众能够亲身体验和感受的。这种在展览特定地点的具体体验是策展空间、艺术品和参观者本身的互动。艺术及创作使我们明白，我们可以用科学的方法了解世界，也需要充满情感的体验生活，阐释现实。', 10, '艺术展览 R座');
INSERT INTO `activity` VALUES (4, '月球与行星科学国家重点实验室（澳门科技大学）（以下简称实验室）由国家科技部批准，于2018年正式挂牌成立，是天文与行星科学领域唯一一个国家重点实验室。 实验室的成立是国家大力发展深空探测，推动粤港澳大湾区科技创新，提升澳门科技水平的重要举措。\n实验室在国家大力发展深空探测的战略指引下，已开展了多项月球与行星科学的基础研究工作，取得了重要成果。 2012年，实验室研究项目「嫦娥探月数据的分析与研究」获得了澳门科学技术奖中的自然科学奖三等奖。 2016年6月，实验室研究项目「嫦娥工程多波段探月资料的科学发现」获得了澳门科学技术奖中的自然科学奖一等奖。 2020年研究项目「月球、小行星、巨行星的表面特征、内部结构研究」获得了澳门科学技术奖中的自然科学奖一等奖。 2022年，研究项目「月球及火星表面环境研究中的科学发现」获得了澳门科学技术奖中的自然科学奖二等奖。 近年实验室人员积极参与火星任务，2022年11月，国家人社部发文，国家六部委授予实验室火星大气团队“首次探测火星任务先进集体”称号及授予肖静助理教授“首次火星任务探测先进 个人”称号。 此外，实验室人员更荣获2023年度联合国外太空事务厅（UNOSA）与欧洲航天局（ESA）联合资助项目：“HyperSpacEx - Medical and Biotechnological Potential of Fungi in Hypergravity for Space Exploration”。 2024年1月，“中华人民共和国澳门特别行政区2023年度勋章、奖章和奖状颁授典礼”中，实验室获授予2023年度专业功绩勋章。\n', 10, '月球实验室参观  A座5楼');
INSERT INTO `activity` VALUES (5, '本次专场精心挑选了5首探戈曲目，由澳门乐团用精湛的演奏技艺为听众带来了一场精彩绝伦的视听盛宴。整场演出所展现出的高水平，令人赞叹不已，每一个音符都紧紧扣住听众的心弦，让听众们真正感受到了富有激情的探戈魅力。 风趣的串场遇上神秘的探戈，野性的乐章遇上美妙的律动，带着听众推开了探戈世界的大门。现场掌声雷动，澳门乐团专场「管弦专场」在听众的不舍中完美落幕。感谢简柏坚先生幽默的讲解与充满热情的指挥，以及乐团成员全身心的投入和精彩绝伦的表演。音乐有休止符，但音乐的魅力和影响力在听众心中永恒跳动。', 10, '音乐表演 R座1楼');
INSERT INTO `activity` VALUES (6, '在校园中找出三处澳门科技大学校名标识并打卡合影，凭照片至J座一楼纪念品商店处兑换小礼品', 0, '打卡领奖品J座');
INSERT INTO `activity` VALUES (7, '搭乘校园观光车可环绕校园一周，每20min一班， 每座大楼正门口为上下车点，每站停靠，购买观光车票后，可不限次数搭乘。', 25, '观光车  每座大楼正门口搭乘');
INSERT INTO `activity` VALUES (8, '校园里面的集装箱小市集——“科大点绽”，汇聚了多家具有特色的小餐厅。 在这里，可以品尝到充满不同地方特色的美食。 “科大点绽”内设有露天空间供食客使用，食客除了可以享受美好的味蕾体验之外，还可以欣赏到澳门科大的靓丽校园景色。', 100, '点绽美食 P座集装箱');
INSERT INTO `activity` VALUES (9, 'The Seasons成立于2014年，旨在为酒店与旅游管理学院新开设的餐饮管理学士学位课程提供培训和体验式学习环境。 The Seasons为烹饪艺术专业和餐厅管理专业的学生提供模拟厨房和餐厅。The Seasons 的主题围绕“从农场到餐桌”的概念，重点是新鲜和有机农产品。 这一概念还包括注重通过在当地采购食品来减少碳足迹。 餐厅的设计体现了这一理念，尽管效果是现代的，但它捕捉到了中国农村农场的纹理、色彩和材料。 校园内有一个名为“体验花园”的市场花园，每天为餐厅提供新鲜蔬菜和香草，同时也是食品和饮料管理学士学位课程“农场到餐桌”课程的教学区。', 328, '季节餐厅  N座1楼');
INSERT INTO `activity` VALUES (10, '夏日艳阳天，阳光是足的，但明媚温柔：科大的芳草地鸟语花香；春是生长：草长莺飞。 正是戏春的好时间。 来吧！ 一齐happy together！从野外出发，澳门科技大学呢有好音乐，有好食,有好饮，最紧要的是同一班好朋友一齐happy！ 小朋友都可以尽情玩耍，总之开心就可以！', 108, '特色餐饮  O座厨艺后门');
